import './App.css';
import './css/header.css';

function Header() {
  return (
    <div className="Header">
      <div class='Logo'>MONKEY SCRIPT</div>

      <ul id="yakors">
        <li><a href="#main2"  title="Link" >Примеры работ</a></li>
        <li><a href="#main3"  title="Link" >Тарифы</a></li>
        <li><a href="#main4"  title="Link" >Контакты</a></li>
      </ul>

      <ul id="regent">
        <li><a href="Enter.html" target="_blank" title="Link" class="btn">Вход</a></li>
        <li><a href="Regist.html" target="_blank" title="Link" class="btn"><small>Регистрация</small></a></li>
      </ul>

    </div>
  );
}

function Main1() {
  return (
    <div className="Main">
      <div id="AboutUs" >
      Уважаемый пользователь, вас приветствует проект Monkey Script! Вы находитесь на главной странице нашего сайта. Здесь вы можете создать рекламное объявление вашего товара или услуги при помощи нейронных сетей.
      </div>

    </div>
  )
}


export default Header;
